import React from 'react';
import Tribe from './assets/Tribe.png'
import Container from '@mui/material/Container'
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';



const Index = () => {
  return( 
    
        <Box sx={{ flexGrow: 1 }}>
            <Grid container sm={12} justifyContent="center" alignItems="center" >
                <Grid item sm={4}><img src={Tribe} alt='tribe' /></Grid>
                <Grid item sm={4}><h1 className='index-header'>Assignment 1</h1></Grid>
                <Grid item sm={4}><h1 className='index-header'>Assignment 2</h1></Grid>
            </Grid>
        </Box> 
    
    )
};

export default Index;
